import { Schema, model } from "mongoose";

const userSchema = new Schema({
  name: String,
  email: String,
  password: String,
  surveys: [String],
  tokens: Number,
  trial: Boolean,
});

export const User = model("User", userSchema);

const surveySchema = new Schema({
  user: String,
  title: String,
  fixed: Boolean,
  questions: [
    {
      type: String,
      title: String,
      isValid: Boolean,
      answers: [
        {
          title: String,
          responses: [
            {
              value: String,
              date: { type: Number },
              freeResponses: String,
            },
          ],
        },
      ],
    },
  ],
});

export const Survey = model("Survey", surveySchema);
